import html5 from "../assets/images/html5.png";
import css3 from "../assets/images/css3.png";
import javascript from "../assets/images/javascript.png";
import typescript from "../assets/images/typesctipt.png";
import react from "../assets/images/react.png";
import redux from "../assets/images/redux.png";
import spring from "../assets/images/spring.png";

const About = () => {
  return (
    <>
      <h1>About</h1>
      <p className="spaziatura">
        Determined, solution oriented, passionate about nature and innovation,
        and driven by curiosity. <br /> I firmly believe in technology's
        potential to drive positive change, <br />
        and my mission is to create a meaningful impact on both the planet and
        society.
      </p>
      <Row className="iconeSkills d-flex flex-row mx-1">
        <Col>
          <img src={html5} alt="logo html5" />
        </Col>
        <img src={css3} alt="logo css3" />
        <img src={javascript} alt="logo javascript" />
        <img src={typescript} alt="logo typescript" />
      </Row>
      <Row className="iconeSkills d-flex flex-row mx-1">
        <img src={react} alt="logo react" />
        <img src={redux} alt="logo redux" />
        <img src={spring} alt="logo spring boot" />
      </Row>
    </>
  );
};
export default About;
